import React from 'react';

class BooleanLogic extends React.Component{
	constructor(props){
		super(props)
	}


	render(){
		return (
			<div>
				welcome to <b>boolean logic</b>! our goal for this page is for you to understand what <b>2B||!2B</b> means! we are going to learn how to make our <b>if statements</b> more complex so that we can check multiple things at once (<b className="note">psst. need a reminder</b> on what in the world if statements are? check out the <b className="pageName">if statements page</b>!). and of course, as the name suggests, we are going to work with <b>booleans</b>! (<b className="note">btw:</b> throwback to the <b className="pageName">variables page</b>... a <b>boolean</b> is a variable type that has only two possible values: <b>true</b> or <b>false</b>.) let's do this.
			</div>
		)
	}
}

export default BooleanLogic;
